import React from "react";
import { Button, Container, Dropdown, Form, Nav, Navbar } from "react-bootstrap";
import logo from "./VERSTAND.png";
import userico from "./user.png";
import { useSelector } from "react-redux";
const NavBarTest = () => {
  const user = useSelector((state) => state.userReducer.user);

  return (
    <Navbar collapseOnSelect expand="lg" bg="white" variant="white">
      <Container>
        <Navbar.Brand href="/">
          <img
            alt="Verstand"
            src={logo}
            width="150"
            height="50"
            className="d-inline-block align-top"
          />{" "}
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Dropdown>
                  <Dropdown.Toggle
                    className="v11"
                    id="dropdown-basic"
                    variant="secondary"
                  >
                    <span className="v3">
                      {" "}
                      <img
                        src={userico}
                        height="15px"
                        className="userico"
                        alt="img"
                      />{" "}
                      {user && user.name}
                    </span>
                  </Dropdown.Toggle>
                 </Dropdown>
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#features">AboutUs</Nav.Link>
            <Nav.Link href="#pricing">ContactUs</Nav.Link>
            <Nav.Link href="#pricing">Products</Nav.Link>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Nav>
          {/* Here we can play  */}
          <Nav>
            <Nav.Link href="#deets">login </Nav.Link>
            <Nav.Link eventKey={2} href="#memes">
             register
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBarTest;
